window.bookSummaryJSON = "<p>From <i>Wall Street Journal</i> best-selling author Aleron Kong comes <i>Awakening</i>, book one of God's Eye, the long-awaited second series of the Labyrinth Universe!</p> <p>Discover a unique new world seen from the perspective of a newly born god in a breathtaking saga of divine proportions.</p> <p>Telos is a world at the center of a Universe. A bright jewel wrapped in a Lattice of realities. It is a world that gods and demons call home at the beginning of a new age. Remy is a newly risen deity, struggling to survive in a Battle Royale where the consequences are worse than death and last longer than damnation.</p> <p>He will find that he cannot live with his tribe of worshippers. Their strength is his, and his is theirs. Other tribes want nothing more than to feast upon their flesh and consume their power. It is a deadly race of technology and power, faith and corruption, of commoners and legends.</p> <p>Gods of ancient pantheons and demons of forbidden nightmares compete in a timeless game where the stakes are the souls of every living being. These old forces will come to fear a newly risen god.</p> <p>His name will become a curse on their lips. His name will be a chant in the mouths of the faithful. His name will be carved in time.</p> <p>Zero Fell, Zero Fell, ZERO FELL! </p> <p>My friends, this book is five years in the making. Set in the same Universe as <i>The Land</i>, I hope you enjoy this new world with new magics. New friends to cheer for and new enemies to hate.</p> <p>As always, I wish you a wonderful life!</p> <p>Peace, love, and the perfect margarita,<br> Aleron Kong</p> <p><b>Other books by Aleron Kong</b></p> <p><i>Chaos Seeds</i></p> <p>The Land Saga</p> <p></p> <ul> <li>Founding</li> <li>Forging</li> <li>Alliances</li> <li>Catacombs</li> <li>Swarm</li> <li>Raiders</li> <li>Predators</li> <li>Monsters</li> </ul>"; 
